/** Get last 5 tweets */if($("#twitter").length){console.log("Get last five tweets.");$.ajax({type:"GET",dataType:"jsonp",cache:!1,url:"http://api.twitter.com/1/statuses/user_timeline.json?screen_name=nassia&count=5",success:function(e){$.each(e,function(e,t){$("#twitter").append("<p>"+t.text+"</p><small>"+t.created_at+"</small><hr/>")})}})}if($("#lastfm").length){console.log("Get last ten scrobbles.");$.ajax({type:"GET",dataType:"jsonp",cache:!1,url:"http://ws.audioscrobbler.com/2.0/?method=user.getrecenttracks&user=nassia_s&api_key=63f2426cee843e2cf84b36b2dd1a94de&format=json",success:function(e){$.each(e.recenttracks.track,function(e,t){$("#lastfm").append("<p>"+t.artist["#text"]+" - "+t.name+"</p>")})}})}if($("#instagram").length){console.log("Get last twenty instagram pictures.");$.ajax({type:"GET",dataType:"jsonp",cache:!1,url:"https://api.instagram.com/v1/users/21311155/media/recent/?access_token=21311155.ab103e5.a7a20249e87f4a4db3614c2c3a203804",success:function(e){var t="<ul class='thumbnails'>";$.each(e.data,function(e,n){t+='<li><a href="'+n.link+'" target="_blank"><img src="'+n.images.thumbnail.url+'" title="'+n.caption.text+'"></a></li>'});t+="</ul>";$("#instagram").append(t)}})};